import React from 'react'
import { Link } from 'react-router-dom'
import axios from 'axios'
import { useState } from 'react';
function SignupCheckOut() {
  let apiKey = "";

  const [name, setName] = useState([]);
  const [email, setEmail] = useState([]);
  const [password, setPassword] = useState([]);
  const [confirmpassword, setConfirmpassword] = useState([]);


  const submitHandler = async(event) => {
    event.preventDefault();
    // const formData = new FormData();
    // formData.append("username", name);
    // formData.append("first_name", "qe");
    // formData.append("last_name", "qw");
    // formData.append("user_type", "boater");
    // formData.append("subscription_type", "free");
    // formData.append("subcription_id", 1);
    // formData.append("email", email);
    // formData.append("password", password);
    // formData.append("user_status", true);

    const payload = {
      "username": name,
     "password": password,
      "email": email,
      "first_name": "mani",
      "last_name": "khan",
      "user_type": "Boater Basic",
      "subscription_type": "free",
      "subcription_id": 1,
      "user_status": true
    }



    // formData.append("category_id", marineCategoryId);
    // formData.append("status", marineStatus);

    // console.log(name, email, password)
    // return 
    // validation 
    if(!name && !email && !password){
        console.log("please fill the field")
        // Swal.fire({
        //     title: 'Warning!!',
        //     text: "please fill the fields",
        //     icon: 'danger',
        //     customClass: {
        //         confirmButton: 'btn btn-primary'
        //     },
        //     buttonsStyling: false
        // })
        return
    }

    try {     
        const response = await axios({
            method: "post",
            url: "http://34.254.97.212:8080/api/users/adduser",
            data: payload,
            headers: { Authorization: apiKey },
        })
        console.log(response)
        // if(response.code == 200){
        //     Swal.fire({
        //         title: 'Done!!',
        //         text: response.data.message,
        //         icon: 'success',
        //         customClass: {
        //             confirmButton: 'btn btn-primary'
        //         },
        //         buttonsStyling: false
        //     })
        // }else{
        //     return Swal.fire({
        //         title: 'Error!!',
        //         text:  response.data.message,
        //         icon: 'Warning',
        //         customClass: {
        //             confirmButton: 'btn btn-primary'
        //         },
        //         buttonsStyling: false
        //     })
        // }
    } catch (error) {
        console.log(error);
        // setFlag(false);
        // return Swal.fire({
        //     title: 'Error!!',
        //     text:  'Something went wrong. Server is not responding!',
        //     icon: 'error',
        //     customClass: {
        //         confirmButton: 'btn btn-primary'
        //     },
        //     buttonsStyling: false
        // })
    }
}

  // const submitHandler =(e) =>{
  //   e.preventDefault()
  //   const name = e.target.name.value;
  //   const email = e.target.email.value;
  //   const password = e.target.password.value;
  //   const confirmpassword = e.target.confirmpassword.value;
  //   axios.post("http://34.254.97.212:8080/api/users/1",{
  //       name,
  //       email,
  //       password,
  //       confirmpassword,
  //   })
  //   .then(res => {
  //     console.log(res);
  //   }); 

  // }

  return (
    <div>
      <div className='main-banner'>
          <div className='container-fluid'>
            <div className='banner-form login checkout'>
               <h4>Sign Up</h4>
                <p className='parah'><i class="fa-regular fa-calendar"></i> Have a coupon? <a href='/'>Click here to enter your code</a> </p>
                <Link className='google-log' to="/"><img src="../../images/icons/google-icon.png" alt="" /> Continue with Google</Link>
                <div className='row'>
                  <form onSubmit={submitHandler}>
                    <div className='col-md-6'>
                      <label>Name <span>*</span></label>
                        <input type='text' value={name} onChange={(e)=> setName(e.target.value)} name='Name'  />

                        <label>Email address <span>*</span></label>
                        <input type='email' name='email' value={email} onChange={(e)=> setEmail(e.target.value)}  required />

                        <label >Create Your New Password (Enter at least 4 character) <span>*</span></label>
                        <input name='password' value={password} onChange={(e)=> setPassword(e.target.value)}  required placeholder="Password"  type='Password' />

                        <label >Confirm Password <span>*</span></label>
                        <input placeholder="Password"  name='confirmpassword' type='Password' />
                        </div>
                        <div className="col-sm-12">
                          <div className="order-table">
                            <h5>Your order</h5>
                            <table className='table w-100'>
                                <thead>
                                  <tr>
                                    <th>Product</th>
                                    <th>&nbsp;</th>
                                  </tr>
                                </thead>
                                <tbody>
                                  <tr>
                                    <td>Boater Basic <b> x 1</b></td>
                                    <td>$0.00</td>
                                  </tr>
                                </tbody>
                                <tfoot>
                                  <tr>
                                    <td> <b>Total</b> </td>
                                    <td> <b>$0.00</b> </td>
                                  </tr>
                                </tfoot>
                            </table>
                            </div>
                        </div>
                        <div className="col-sm-12">
                            <div className="gray-bg">
                                <button>Create Account</button>          
                            </div>
                      </div>
                  </form>
                </div> 
              </div>
          </div>
        </div>
    </div>
  )
}

export default SignupCheckOut
